    address: "ул. Волхонка, 10",
    link: "https://pushkinmuseum.art/museum/buildings/olk/index.php?lang=ru",
    description:
      "Отдел личных коллекций – один из самых молодых и необычных музеев страны. Решение о его создании в качестве Отдела ГМИИ им. А.С. Пушкина было принято в 1985 году. Мысль об основании музея, поддержанная И.А. Антоновой, принадлежит искусствоведу, литературоведу и общественному деятелю И.С. Зильберштейну, передавшему свою коллекцию ГМИИ им. А.С. Пушкина. Отдел хранит и экспонирует переданные ему почти восьмидесятью дарителями более сорока коллекций и наследий художников, сохраняя целостность собраний. С самого начала перед Отделом ставились две задачи: показать индивидуальную специфику выдающихся личных коллекций, превращенных в результате передачи музею из достояния частного в достояние общественное, и дать, тем самым, стимул и другим коллекционерам пойти по тому же пути. Такой подход позволял продемонстрировать зрителям заслуги собирателя и особенности каждой из коллекций.",
